import './nav.css';

const Nav = ()=>{
    return(
        <nav className="navbar navbar-expand-lg">
            <div className="container-fluid p-5">
                <a className="navbar-brand mt-2" href="#"><h3 className="fw-bold fs-2">UrNOTES</h3></a>
                <div className="navbar-nav">
                    <a className="nav-link mx-5" href="#">Create</a>
                    <a className="nav-link mx-5" href="#">Search</a>
                    <a className="nav-link mx-5" href="#">Login</a>
                </div>
            </div>
        </nav>
    );
}

export default Nav;
